/**
 * 本地随机背景
 */
function bdbg(style) {
	if (bgstyle == 1) {
		showMessage("当前背景已是离线本地背景！");
	} else {
		if (style) {
			showMessage("成功切换到离线本地背景！");
		}
		$("#bgkg").text("暂停背景");
		bgpd = true;
		bgstyle = 1;
		clearInterval(bgs);
		bgs = setInterval(function() {
			rand = random(1, 99);
			preloadimages(['./images/P_img/' + rand + '.jpg']).done(function(images) {
				$("body").css("background-image", "url(./images/P_img/" + rand + ".jpg),url(./images/jz.gif)");
			});
			
		}, 60000);
	}
}
