/**
 * 暂停背景
 */
var bgpd = false;
function ztbg() {
	$bgkg = $("#bgkg");
	if (bgpd) {
		$bgkg.text("恢复背景");
		bgpd = false;
		clearInterval(bgs);
		showMessage("随机背景已停止！");

	} else {
		$bgkg.text("暂停背景");
		showMessage("随机背景已恢复！");
		bgpd = true;
		switch (bgstyle) {
			case 1:
				bgstyle = 0;
				bdbg(false);
				break;
			case 2:
				bgstyle = 0;
				fjbg(false);
				break;
			case 3:
				bgstyle = 0;
				dmbg(false);
				break;
			default:
				alert("背景程序错误！");
		}
	}
}
/**
 * 取随机数
 */
function random(lower, upper) {
	return Math.floor(Math.random() * (upper - lower)) + lower;
}

