/**
 * 消息框
 */
function showMessage(text) {
	$("body").append(
		"<div id='errs' style='height: 50px;text-align: center;font-size:22;z-index: 2000000;border:10px #00BCD4 double;padding: 5px 10px;border-radius: 5px;position: fixed; top: 45%;left: 45%;color: #f00;background-color: #fff;'>" +
		text + "</div>");
	$("#errs").fadeOut(3000);
	window.setTimeout(function() {
		$("#errs").remove();
	}, 3000);
};


















































































































































































































































































































































































































































































